import React from 'react';


function ExpenseItem() {
    return(
        <div className="expense-item">
            <div>November 19 2022</div>
            <div className="expense-item__description">
                <h2>Car Expense</h2>
                <div className="expense-item__price">$294</div>
            </div>
        </div>
    );
}

export default ExpenseItem;
